import React from 'react';

const App = ({Component}) => {
  return (
    <>
    <Head>
      <meta charSet="utf-8"></meta>
      <title>NodeBird</title>
    </Head>
    <Component />
    </>
  )
}

App.PropTypes = {
  Component: PropTypes.elementType.isRequired
}

export default App;
